import React, { Component } from "react";
import axios from "axios";

class Home extends Component {
  state = {
    videos: []
  };
  apiEndPoint = "http://localhost:5000/api/videos";

  componentDidMount = () => {
    let data = {};

    // Send a GET request
    axios
      .get(this.apiEndPoint)
      .then(response => {
        data = response.data;

        this.setState({
          videos: data
        });
      })
      .catch(function(error) {
        // handle error
        console.log(error);
      });
  };

  render() {
    const { videos } = this.state;
    return (
      <ul className="list-group">
        {videos.map(video => (
          <li className="list-group-item">Cras justo odio</li>
        ))}
      </ul>
    );
  }
}

export default Home;
